import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import WhatshotIcon from '@material-ui/icons/Whatshot';
import './ExploreCard.css';
const useStyles = makeStyles({
    root: {
        minWidth: 275,
    },
    bullet: {
        display: 'inline-block',
        margin: '0 2px',
        transform: 'scale(0.8)',
    },
    title: {
        fontSize: 14,
    },
    pos: {
        marginBottom: 12,
    },
});

export default function SimpleCard({ icon, title }) {

    return (
        <Card className="explorecard">
            <CardContent className="explorecard__content">
                <div className="explorecard__content__icon">
                    <img
                        src={icon}
                        alt=""
                    />
                    {/* <WhatshotIcon /> */}
                    <p>{title}</p>
                </div>
                {/* <Typography className="explorecard__content__icon" variant="h5" component="h2">
                </Typography>
                <Typography variant="body2" component="h3">
                    React
                </Typography> */}
            </CardContent>
        </Card>
    );
}
